// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

contract EscrowWithoutArbiter {
    address public beneficiary;
    address public depositor;

    bytes32 public proofHash;

    constructor(address _beneficiary, string memory _proof) payable {
        beneficiary = _beneficiary;
        depositor = msg.sender;
        proofHash = keccak256(abi.encodePacked(_proof));
    }

    event Approved(uint);

    function approve(string memory _proof) external {
        require(msg.sender == beneficiary);
        require(keccak256(abi.encodePacked(_proof)) == proofHash, "Invalid proof");
        uint balance = address(this).balance;
        (bool sent, ) = payable(beneficiary).call{value: balance}("");
        require(sent, "Failed to send Ether");
        emit Approved(balance);
    }
}

